private static final Strategy ABBREVIATED_YEAR_STRATEGY = new NumberStrategy(Calendar.YEAR) {

    /**
     * {@inheritDoc}
     */
    @Override
    int modify(final FastDateParser parser, final int iValue) {
        return iValue < 100 ? parser.adjustYear(iValue) : iValue;
    }
};

private static final Strategy NUMBER_MONTH_STRATEGY = new NumberStrategy(Calendar.MONTH) {

    @Override
    int modify(final FastDateParser parser, final int iValue) {
        return iValue - 1;
    }
};

private static final Strategy DAY_OF_WEEK_STRATEGY = new NumberStrategy(Calendar.DAY_OF_WEEK) {

    @Override
    int modify(final FastDateParser parser, final int iValue) {
        return iValue == 7 ? Calendar.SUNDAY : iValue + 1;
    }
};

private static final Strategy HOUR24_OF_DAY_STRATEGY = new NumberStrategy(Calendar.HOUR_OF_DAY) {

    @Override
    int modify(final FastDateParser parser, final int iValue) {
        return iValue == 24 ? 0 : iValue;
    }
};

private static final Strategy HOUR12_STRATEGY = new NumberStrategy(Calendar.HOUR) {

    @Override
    int modify(final FastDateParser parser, final int iValue) {
        return iValue == 12 ? 0 : iValue;
    }
};

private static final AbstractFormatCache<FastDateFormat> cache = new AbstractFormatCache<FastDateFormat>() {

    @Override
    protected FastDateFormat createInstance(final String pattern, final TimeZone timeZone, final Locale locale) {
        return new FastDateFormat(pattern, timeZone, locale);
    }
};

private static final ThreadLocal<SecureRandom> SECURE_RANDOM_STRONG = ThreadLocal.withInitial(() -> {
    try {
        return SecureRandom.getInstanceStrong();
    } catch (final NoSuchAlgorithmException e) {
        throw new UncheckedException(e);
    }
});

private static final ToStringStyle TO_STRING_STYLE = new ToStringStyle() {

    /**
     * Serialization version
     */
    private static final long serialVersionUID = 1L;

    {
        setDefaultFullDetail(true);
        setArrayContentDetail(true);
        setUseClassName(true);
        setUseShortClassName(true);
        setUseIdentityHashCode(false);
        setContentStart("(");
        setContentEnd(")");
        setFieldSeparator(", ");
        setArrayStart("[");
        setArrayEnd("]");
    }

    /**
     * {@inheritDoc}
     */
    @Override
    protected void appendDetail(final StringBuffer buffer, final String fieldName, Object value) {
        if (value instanceof Annotation) {
            value = AnnotationUtils.toString((Annotation) value);
        }
        super.appendDetail(buffer, fieldName, value);
    }

    /**
     * {@inheritDoc}
     */
    @Override
    protected String getShortClassName(final Class<?> cls) {
        // formatter:off
        return ClassUtils.getAllInterfaces(cls).stream().filter(Annotation.class::isAssignableFrom).findFirst().map(iface -> "@" + iface.getName()).orElse(StringUtils.EMPTY);
        // formatter:on
    }
};
